import React from 'react';

const NavBar = () => {
    return (
        <>
            <nav className="Navigation">

                <img src="../ironhack-logo.svg" alt="Logo ironhack" />
                <img src="../menu-top.svg" alt="Menu" />
            </nav>
        </>
    )
}

export default NavBar
